// component for feed 
import React from 'react';
import { View, Text, StyleSheet, Button } from 'react-native';

const Feed = () => {
    return (
    <View style={styles.container}>
      <Text>Feed Screen</Text>
    </View>
  );
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center'
        }
        }
        );
        
export default Feed;
